text327040.addInnerText('<div id=\"text327040\" aria-live=\"off\" ><p lang=\"en\"  legLH=\"1.691\" style=\"margin-left:0px;text-indent:0px;line-height:1.620;margin-top:0px;margin-bottom:0px;text-align:center;\" >\n<span class=\"text327040Font1\" style=\"position:relative;top:-4px;\" >Setiap pelaku usaha bisa memperoleh modal dengan mengajukan Bantuan Modal Usaha kepada Badan Amal Zakat Nasional (Baznas) di tiap kota masing-masing. Bantuan modal usaha diberikan dengan tujuan untuk meningkatkan dan mengembangkan usaha para pelaku UMKM. Dalam program ini Baznas menyiapkan bantuan uang modal usaha hingga peralatan modal usaha yang dibutuhkan masyarakat. \n</span ></p >\n<p  legLH=\"1.691\" style=\"margin-left:0px;text-indent:0px;line-height:1.620;margin-top:0px;margin-bottom:0px;text-align:center;\" >\n<span class=\"text327040Font1\" style=\"position:relative;top:-4px;\" >Kamu bisa mencoba dengan menghubungi Baznas yang ada di kota mu!</span ><span class=\"text327040Font2\" style=\"background-color:transparentposition:relative;top:-4px;\" >\n</span ></p ></div>\n');

text327041.addInnerText('<div id=\"text327041\" aria-live=\"off\" ><p lang=\"en\"  legLH=\"1.691\" style=\"margin-left:0px;text-indent:0px;line-height:1.620;margin-top:0px;margin-bottom:0px;text-align:center;\" >\n<span class=\"text327041Font1\" style=\"position:relative;top:-4px;\" >Jika rintisan usaha kamu sudah mulai berjalan, kamu bisa memanfaatkan Kredit Usaha Rakyat (KUR) untuk modal mengembangkan usaha kamu. KUR adalah program pemerintah Indonesia yang menyediakan pembiayaan modal usaha kepada Usaha Mikro, Kecil, dan Menengah (UMKM) dengan bunga rendah dan persyaratan mudah.\n</span ></p ></div>\n');

text327042.addInnerText('<div id=\"text327042\" aria-live=\"off\" ><p lang=\"en\"  legLH=\"1.409\" style=\"margin-left:0px;text-indent:0px;line-height:1.350;margin-top:0px;margin-bottom:0px;text-align:center;\" >\n<span class=\"text327042Font1\" style=\"position:relative;top:-2px;\" >Program Kartu Prakerja adalah program beasiswa pelatihan untuk meningkatkan kompetensi kerja dan kewirausahaan. Program ini untuk semua orang yang ingin meningkatkan kemampuan dan kompetensi mereka.\n</span ></p >\n<p  legLH=\"1.409\" style=\"margin-left:0px;text-indent:0px;line-height:1.350;margin-top:0px;margin-bottom:0px;text-align:center;\" >\n<span class=\"text327042Font1\" style=\"position:relative;top:-2px;\" >Melalui program ini, kamu bisa mengikuti pelatihan online sesuai dengan minat dan kebutuhan kamu. Jika kamu lolos seleksi akan mendapatkan bantuan biaya pelatihan dan insentif setelah menyelesaikan pelatihan. \n</span ></p >\n<p  legLH=\"1.409\" style=\"margin-left:0px;text-indent:0px;line-height:1.350;margin-top:0px;margin-bottom:0px;text-align:center;\" >\n<span class=\"text327042Font1\" style=\"position:relative;top:-2px;\" >Insentif tersebut bisa kamu gunakan untuk tambahan modal merintis usaha kecil. Selain uang, kamu juga mendapatkan modal pengetahuan dan keahlian!\n</span ></p ></div>\n');
